import React from "react";
import LoginPage from "./components/pages/Login/LoginPage";
import { BrowserRouter, Route } from "react-router-dom";

import LoginFormLeft from "./components/pages/Login/forms/LoginFormLeft";
import LoginFormRightLogin from "./components/pages/Login/forms/LoginFormRightLogin";
import LoginFormRightSignUp from "./components/pages/Login/forms/LoginFormRightSignUp";
import ProfilePage from "./components/pages/profile/ProfilePage";
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <BrowserRouter>
        <Route exact path="/" component={LoginPage}>
          <LoginFormLeft />
          <Route exact path="/" component={LoginFormRightLogin} />
          <Route path="/signup" component={LoginFormRightSignUp} />
        </Route>

      </BrowserRouter>
    );
  }
}

export default App;
